PROBLEM: 'Let '$f$' be a function defined on the set of positive rational numbers with the property that '$f(a\cdot b)=f(a)+f(b)$' for all positive rational numbers '$a$' and '$b$'. Suppose that '$f$' also has the property that '$f(p)=p$' for every prime number '$p$'. For which of the following numbers '$x$' is '$f(x)<0$'?\n'
=======
CHOICES:
[A]: \frac{17}{32}
[B]: \frac{11}{16}
[C]: \frac79
[D]: \frac76
[E]: \frac{25}{11}

PROBLEM: 'Suppose that the roots of the polynomial '$P(x)=x^3+ax^2+bx+c$' are '$\cos \frac{2\pi}7,\cos \frac{4\pi}7,$' and '$\cos \frac{6\pi}7$', where angles are in radians. What is '$abc$'?\n'
=======
CHOICES:
[A]: {-}\frac{3}{49}
[B]: {-}\frac{1}{28}
[C]: \frac{\sqrt[3]7}{64}
[D]: \frac{1}{32}
[E]: \frac{1}{28}

PROBLEM: 'Frieda the frog begins a sequence of hops on a '$3 \times 3$' grid of squares, moving one square on each hop and choosing at random the direction of each hop-up, down, left, or right. She does not hop diagonally. When the direction of a hop would take Frieda off the grid, she "wraps around" and jumps to the opposite edge. For example if Frieda begins in the center square and makes two hops "up", the first hop would place her in the top row middle square, and the second hop would cause Frieda to jump to the opposite edge, landing in the bottom row middle square. Suppose Frieda starts from the center square, makes at most four hops at random, and stops hopping if she lands on a corner square. What is the probability that she reaches a corner square on one of the four hops?\n'
=======
CHOICES:
[A]: ~\frac{9}{16}
[B]: ~\frac{5}{8}
[C]: ~\frac{3}{4}
[D]: ~\frac{25}{32}
[E]: ~\frac{13}{16}
